function triangle(row) {
  return better_triangle(row);
}
function better_triangle(row) {
  const ss = row.split("");

  function traverl() {
    const length = ss.length;
    // console.log(ss.length);
    let prev = ss[0];
    for (let i = 1; i < length; i++) {
      const cur = ss[i];
      const result = getNext(prev, cur);
      prev = cur;
      ss[i - 1] = result;
    }
  }

  while (ss.length !== 1) {
    traverl();
    ss.length = ss.length - 1;
  }
  return ss.shift();
}

const colorCompaliment = {
  G: {
    B: "R",
    R: "B"
  },
  B: {
    R: "G",
    G: "R"
  },
  R: {
    G: "B",
    B: "G"
  }
};

function getNext(aColor, bColor) {
  if (aColor == bColor) {
    return aColor;
  }
  return colorCompaliment[aColor][bColor];
}

